import React from "react";
import { Fragment } from "react";

import Card from "./components/card";

class Knowledge extends React.Component {
  render() {
    return (
      <Fragment>
        <div className="card-group text-center">
          <Card
            section="HTML"
            text="The standar HTML5 markup languaje. Medium-high level to be able to build a large number of web pages."
          />
          <Card
            section="CSS"
            text="The graphic design language in cascading to define and create a web page.\n"
          />
          <Card
            section="JavaScript"
            text="This is one of my favorites. This language add the functionality to the web page. Requires logic and lateral think."
          />
          <Card section="Projects" text="Personal projects running for test" />
          <Card section="Contact" text="Social Media to contact and chat me!" />
        </div>
      </Fragment>
    );
  }
}
export default Knowledge;
